import "./Login.css";
import { FaArrowLeft } from "react-icons-fa"

const Login = () => {

    return (
        <div className="Login">
            <div className="ModalLogin">
                <div className="Header">
                    <FaArrowLeft/>
                </div>
                <div className="Body">
                    
                </div>
                <div className="Footer">

                </div>
            </div>
        </div>
    )
}

export default Login;
